import React from 'react';
import ReactDOM from 'react-dom';
import './Contributors.css';
import data from './ContributorData.json'
import App from './'

function Contributers() {
    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Contributers
                </p>
            </header>
            {data.Contributors};
        </div>
    );
}

export default Contributers;

